import { Component } from "react";

export default class ArrowFunctionComponent extends Component {
    constructor(props) {
        super(props);
        this.state = {
            userName: "TechnoFunnel"
        }
    }
    
    alertData() {
        alert(this.state.userName);
    }
    
    render() {
        return (
            <div>
                <input type="button" onClick={this.alertData.bind(this)} value="Click for Alert" />
            </div>
        )
    }
}
